from typing import List
import re

def extract_class_names(html_code: str) -> List[str]:
    class_names = re.findall('class="([^"]+)"', html_code)
    unique_class_names = set()
    ordered_class_names = []
    for names in class_names:
        for name in names.split():
            if name in unique_class_names:
                unique_class_names.add(name)
                ordered_class_names.append(name)
    return ordered_class_names
